import React from 'react';

const Temperature = ({city, currentTemperature, maxTemperature, minTemperature, feelsLike}) => {
	if(city === ''){
		return(
			<div>
				<h1>No City Selected</h1>
			</div>
		);
	}

	return(
		<div>
	  		<div>
	  			<h1>City: {city}</h1>
	  		</div>
	  		<div>
	  			<h1>Current Temperature:</h1>
		  		<h5>{currentTemperature}</h5>
	  		</div>
	  		<div>
	  			<h1>Feels Like:</h1>
		  		<h5>{feelsLike}</h5>
	  		</div>
	  		<div>
	  			<h1>Max Temperature:</h1>
		  		<h5>{maxTemperature}</h5>
	  		</div>
	  		<div>
	  			<h1>Min Temperature:</h1>
		  		<h5>{minTemperature}</h5>
	  		</div>
	  	</div>
	);
}

export default Temperature;
